大堆，也“没有失败的菜”。服务“很周到”，服务生基本上“随叫随到”，请客吃饭“绝对不掉价”。','010100',31.2021,121.457,36,'0','2010-01-02 00:00:00','2011-07-18 05:08:49'),(23001,2,'台湾福建菜X','唐宫海鲜舫','中山西路888号银河宾馆2层','021-62198898','暂无描述信息.','050110',31.2042,121.411,36,'B0015565M5','2010-01-02 00:00:00','2011-07-18 05:08:50'),(23007,2,'日韩料理X','韩国馆(遵义南路)','遵义南路9号万都商城2层S204-S205','021-52081379','一落座，照例先上一排冷碟，有“酸酸甜甜”的色拉，也有“脆脆辣辣”的韩国泡菜。牛舌厚度“适中”，烤好后“颇有质感”，吃上去“嚼劲十足”；海鲜饼“令人惊艳”，味道“不错”。服务员虽“不殷勤”但“蛮周到”，“有问必答”，感觉贴心。 ','050203',31.2049,121.405,36,'B00155Q66X','2010-01-02 00:00:00','2011-07-18 05:08:51'),(23009,2,'咖啡面包甜点X','星巴克咖啡(万都店)','兴义路8号万都中心大厦1层S102、S106商铺','021-52082980','暂无描述信息.','050500',31.2046,121.405,36,'B00155H8T3','2010-01-02 00:00:00','2011-07-18 05:08:52'),(23013,2,'小吃快餐X','肯德基(仙霞店)','仙霞路608','021-62423574','暂无描述信息.','050300',31.2058,121.39,36,'B00155H7HB','2010-01-02 00:00:00','2011-07-18 05:08:52'),(23019,8,'五星级宾馆X','上海展讯豪生酒店','祖冲之路2288弄','021-61097666','荣膺“2007豪生国际酒店集团年度最佳酒店”的上海展讯豪生酒店是上海浦东地区一家豪生品牌酒店。酒店距上海新国际博览中心仅10分钟车程，是您会展期间的理想之地。搭乘地铁二号线15分钟即可到达上海金融及商业中心。便捷的高速公路25分钟带您直达浦东国际机场。\r\n　　倍受赞誉的红廊餐厅汇聚西式和亚洲美食，浅草日式寿司吧呈现新鲜美味的日式料理，皆是享用美食的最佳选择。住店客人还可免费使用沪上规模最大的配有室内游泳池的专业威尔士健身中心；酒店还设有“意”水疗会所，是您一天工作后的理想休闲放松场所。另外，酒店还有穿梭于','100102',31.2109,121.626,36,'0','2010-01-02 00:00:00','2011-07-18 05:08:53'),(23021,1,'洗车养护装饰X','星巴克咖啡','上海市长宁区江苏路369号','021-52400975','暂无描述信息.','010500',31.2163,121.594,36,'0','2010-01-02 00:00:00','2011-07-18 05:08:54'),(23023,1,'加油加气站X','上海东锦江索菲特大酒店','上海市浦东新区杨高南路889号','021-50504888','毗邻世博会浦东园区，上海东锦江索菲特大酒店以其枢纽位置便捷通往上海商业中心。酒店东西两楼拥有设施齐全的豪华客房，6个风格迥异的特色餐厅，1个健身中心，温水游泳池和室外网球场，酒店会议室可满足最多600人的会议需求。豪华五星级酒店的专业服务将为您提供完美的入住体验以确保您的商务之旅舒适精彩。\r\n　　上海东锦江索菲特双塔以至高47层傲然屹立于浦东, 俯瞰浦江两岸,美景尽收眼底，新建东楼405间豪华客房于2010年4月1日倾情奉献。180米高空旋转餐厅X-Sensation更是为您提供用餐、聚会绝佳场所。\r\n','010100',31.2108,121.534,36,'0','2010-01-02 00:00:00','2011-07-18 05:08:54'),(23025,2,'综合酒楼X','小巴辣子川湘菜餐厅巴黎春天店','浦建路118号巴黎春天4层','021-51925355','暂无描述信息.','050101',31.2085,121.52,36,'B00155LRYG','2010-01-02 00:00:00','2011-07-18 05:08:54'),(23027,4,'票务X','如家快捷酒店餐厅','上海市浦东新