'如家快捷酒店(上海中山公园店)','定西路1018号','021-62110988',' 如家快捷酒店（上海中山公园店）座落于长宁区定西路（延安西路路口），紧邻地铁3、4号线“延安西路站”的2号出口美景如画的凯桥绿地公园位于其旁。到地铁2号线的“中山公园站”步行约10分钟，距机场6号线步行5分钟，地处长宁区商务中心；毗邻静安寺、中山公园和徐家汇商圈，延安高架，内环高架及其它交通枢纽信步可达，上海国际展览中心、世贸商城及各类商务、餐饮、娱乐场所近在咫尺，到虹桥国际机场、外滩、人民广场和浦东陆家嘴金融区便利。 ','100105',31.2112,121.424,36,'B00155KSLR','2010-01-02 00:00:00','2011-07-18 05:48:37'),(36803,2,'综合酒楼X','大公馆','东湖路7号','021-64157777;021-641','到底是“杜月笙的公馆”，“旧时上好的家具”躺在那里“泛着冷光”；那楼梯那扇门、那些“气派”的玄关、雪茄室“不晓得看过了多少繁华恩怨”；窗外就是草坪和绿树，视野“非常舒服”。出品以本帮菜为主，也有“由正宗粤菜师傅掌勺”的燕鲍翅可点。“对老上海风情和历史有点好奇”的老外，或是“荷包鼓鼓又比较怀旧”的人可以去尝尝鲜。','050101',31.2155,121.455,36,'B00154YOYW','2010-01-02 00:00:00','2011-07-18 05:48:39'),(36815,2,'咖啡面包甜点X','星巴克咖啡(锦延店)','锦延路219号','021-61633789','暂无描述信息.','050500',31.2164,121.54,36,'B00155L44B','2010-01-02 00:00:00','2011-07-18 05:48:41'),(36847,4,'中介服务X','正浩房产(丹桂路)','上海市浦东新区丹桂路11号','013391182528','暂无描述信息.','071600',31.2146,121.614,36,'B001558BNC','2010-01-02 00:00:00','2011-07-18 05:48:46'),(36851,9,'果品菜场X','杨浦大桥观光进口','上海市浦东新区内环高架路','','暂无描述信息.','060705',31.2517,121.55,36,'B00155KGJX','2010-01-02 00:00:00','2011-07-18 05:48:47'),(36857,4,'美容美发X','妮可人美容减肥会所','上海市南汇区康沈路1947号','021-68113666','暂无描述信息.','071100',31.1093,121.581,36,'B00155QMO3','2010-01-02 00:00:00','2011-07-18 05:48:48'),(36867,6,'游戏厅X','台球游艺厅(莘松路)','上海市闵行区莘松路','','暂无描述信息.','080305',31.1017,121.364,36,'B00155DD3C','2010-01-02 00:00:00','2011-07-18 05:48:49'),(36885,2,'咖啡面包甜点X','歌顿咖啡外高桥二店','新桥镇','','暂无描述信息.','050500',31.1001,121.358,36,'B00155L491','2010-01-02 00:00:00','2011-07-18 05:48:52'),(36887,2,'小吃快餐X','肯德基(永新店)','淮海中路887号B1层','021-54560431','暂无描述信息.','050300',31.2174,121.461,36,'B00155H7I1','2010-01-02 00:00:00','2011-07-18 05:48:52'),(36889,3,'购物中心X','唐人国际购物中心','上海市浦东新区唐陆公路16号','','暂无描述信息.','060100',31.224,121.648,36,'B00155LYB7','2010-01-02 00:00:00','2011-07-18 05:48:52'),(36893,2,'台湾福建菜X','新花城蟹粉馆','乌鲁木齐北路538','021-62482367;021-624','暂无描述信息.','050110',31.2172,121.444,36,'B00152BCA8','2010-01-02 00:00:00','2011-07-18 05:48:53'),(36909,4,'洗浴推拿X','新泾