1557GC4','2010-01-02 00:00:00','2011-07-18 05:49:08'),(36997,3,'便民商店/便利店X','建安综合商店','上海市南汇区黄赵路','021-58944884','暂无描述信息.','060200',31.1421,121.664,36,'B0015578OD','2010-01-02 00:00:00','2011-07-18 05:49:09'),(37007,2,'小吃快餐X','肯德基(柳林店)','淮海中路1号','021-63842971','暂无描述信息.','050300',31.2253,121.48,36,'B00155H7FD','2010-01-02 00:00:00','2011-07-18 05:49:10'),(37019,8,'经济型连锁酒店X','莫泰268商务自助酒店(上海羽山店)','羽山路166号','021-51790888','莫泰268（上海羽山路店）是美林阁莫泰集团下新经济性酒店，其风格更趋温馨、时尚、精致。酒店位于浦东繁华的陆家嘴金融商贸区，毗邻著名的东方路商业街，与源深体育场隔窗相望，交通便利。酒店拥有各类具有现代气息的双人房、大床房，免费宽带上网。同时一楼的上海著名品牌美林阁餐饮拥有250个餐位，其中有风格迥异，装饰新颖时尚，别具一格的包房9个。本酒店是您商务旅游休闲用餐的理想场所','100105',31.23,121.539,36,'B00155IN2S','2010-01-02 00:00:00','2011-07-18 05:49:12'),(37023,2,'休闲其他X','85度C(威海店)','威海路600号','021-62187693','暂无描述信息.','050400',31.2293,121.46,36,'B00155FUCS','2010-01-02 00:00:00','2011-07-18 05:49:12'),(37027,2,'台湾福建菜X','阿童木火锅','上海市淮海中路158号B1楼(近普安路) ','021-63874777','\r\n    环境“蛮好的”，“红色”的主调，随处可见的“阿童木”元素，很适合走“可爱”路线的MM们。锅底种类“多多”，还可以任选两种口味“双拼”，感觉真是“赚到了”；调料“按自己喜好来”，品种“丰富”且“新鲜”；涮菜种类“跟一般火锅店没太大差别”，性价比 “不错”。服务还可以，不过有时店里“太忙”就顾不过来了。 P.S.满100元送大头贴或者美甲服务。','050110',31.2246,121.477,36,'B00155L9NC','2010-01-02 00:00:00','2011-07-18 05:49:13'),(37033,8,'五星级宾馆X','上海波特曼丽嘉酒店(南二门)','南京西路1376号','021-62798888','　　上海波特曼丽嘉酒店地处著名的南京路，是一家集零售、餐饮和娱乐于一体的综合性酒店。\r\n　　上海波特曼丽嘉酒店餐厅和酒廊包括茶园咖啡厅，夏苑中餐厅，花筐日餐厅，帕兰朵意大利餐厅，丽嘉酒吧和大堂酒廊。\r\n　　上海波特曼丽嘉酒店的会议设施包括一个510平方米的宴会会议厅（内含160平方米的会议准备空间）、七个可容纳90人的会议厅。与酒店毗邻的上海商城中厅可举行800人的鸡尾酒会，能容纳991人的多功能剧院可举行多种表演和会议，曾举行过多次重大活动并接待了各界政要人物。 ','100102',31.2266,121.452,36,'B00155KH1I','2010-01-02 00:00:00','2011-07-18 05:49:14'),(37037,2,'日韩料理X','渔福日本料理','东方路989号中达广场1层','021-50589577','暂无描述信息.','050202',31.2214,121.53,36,'B00155K8PW','2010-01-02 00:00:00','2011-07-18 05:49:14'),(37039,2,'咖啡面包甜点X','星巴克咖啡城建店','福山路500号城建国际中心101','021-58301323','暂无描述信息.','050500',31.2222,121.529,36,'B00155H8RL','2010-01-02 00:00:00','2011-07-18 05:49:14'),(37043,2,'日韩料理X','娘家韩国料理','南泉路12号','021-68758836','“蛮家常”的朝鲜料理馆。烤五花肉都是服务生“帮忙烤好”的，虽然少了点“自己动手”的乐趣，但也“少了油烟味”。五花肉“嫩嫩”的，汁水“很多”，想想“就流口水”。石锅饭、泡菜饼也“不错”。店“小”生意却“红火”，每天有“很多鲜族同胞”来吃。 ','050203',31.2234,121.52,36,'B00155ME93','2010-01-02 00:00:00','2011-07-18 05:49:15'),(37049,8,'三星级宾馆X','上海云峰大饭店','北京西路1700号','021-62585922;021-625','　　上海云峰大饭店地处静安寺，拥有著名的云峰剧院，位于北京西路1700号（万航渡路口），交通便捷，购物便利，距南京路商业街、地铁二号线静安寺站、机场航站楼步行只需3分钟；距上海展览中心500米。\r\n　　上海云峰大饭店于2004年对客房、餐厅的设备进行了更新改造，客房宽敞、舒适、典雅，设备齐全。餐厅拥有风格各异的宴会厅18个，菜肴以本帮为主，一次可同时供450人用膳。\r\n　　云峰剧院可容纳1500人，还有120人会议室1个，30人会议室1个，贵宾休息室1个；拥有娱乐总汇（KTV包房、棋牌室、足疗保健中心）等','100104',31.2258,121.443,36,'B001550802','2010-01-02 00:00:00','2011-07-18 05:49:16'),(37051,8,'三星级宾馆X','上海枫蓝商务酒店','延平路10-58号','021-52280222','　　上海枫蓝商务酒店是一家大型多功能的商务型酒店，以其典雅的品味竭诚欢迎每一位宾客。饭店座落于上海静安区，交通极为便利。饭店拥有设计时尚、设备先进的客房及套房。高速因特网接口、国际卫星频道电视以及个性化、便捷的服务为您营造温馨、舒适的居家生活。并有风格各异的餐厅和会议厅、商务中心、旅游服务、康乐中心、桑拿中心、美容厅、健身房、票务中心、商场、咖啡厅等各类配套设施。 ','100104',31.2276,121.442,36,'B00155KJC2','2010-01-02 00:00:00','2011-07-18 05:49:16'),(37055,3,'便民商店/便利店X','利群杂货店','上海市南汇区川周公路','','暂无描述信息.','060200',31.1492,121.636,36,'B001557G7P','2010-01-02 00:00:00','2011-07-18 05:49:17'),(37059,11,'展会展馆X','上海环球金融中心会议中心','世纪大道100号上海环球金融中心','021-68880888','暂无描述信息.','140300',31.2346,121.507,36,'B00155IR0Y','2010-01-02 00:00:00','2011-07-18 05:49:17'),(37075,3,'数码家电X','如意家电专卖','上海市浦东新区上南路3886号','','暂无描述信息.','060300',31.1302,121.519,36,'B001557Q67','2010-01-02 00:00:00','2011-07-18 05:49:19'),(37079,13,'停车场X','美泉宫停车场','上海市闵行区龙茗路25号新梅广场6666弄美泉宫门口和地下一层','','暂无描述信息.','150900',31.1218,121.391,36,'B00155LCAQ','2010-01-02 00:00:00','2011-07-18 05:49:20'),(37089,3,'果品菜场X','赵行农贸市场','上海市南汇区黄赵路','','暂无描述信息.','060703',31.1422,121.664,36,'B001558B3T','2010-01-02 00:00:00','2011-07-18 05:49:22'),(37099,3,'家居建材X','时尚品牌家具馆','真北路1208号上海红星美凯龙家具装饰3层','021-45886202','暂无描述信息.','060600',31.241,121.384,36,'B00155HLIP','2010-01-02 00:00:00','2011-07-18 05:49:23'),(37105,2,'咖啡面包甜点X','星巴克咖啡(鸿翔店)','南京西路869号','021-62581941','暂无描述信息.','050500',31.2302,121.462,36,'B00155H8S1','2010-01-02 00:00:00','2011-07-18 05:49:24'),(37109,2,'综合酒楼X','盘湾方舟','凯旋北路1555弄5号','021-52688822;021-526','坐落在清水湾小