INSERT INTO `pois_tmp` VALUES (64009,8,'经济型连锁酒店X','汉庭快捷酒店(东方路店)','峨山路91弄38号陆家嘴软件园内','021-58890022;021-588','　汉庭酒店连锁是由著名投资机构——力山投资专为商务人士量身打造的中档连锁酒店。汉庭商务酒店（上海东方路店）是上海第六家汉庭品牌酒店。\r\n　　汉庭快捷酒店（上海东方路店）地理位置优越，西连八佰伴商业区、陆家嘴金融贸易区；东接新上海博览中心、花木地区；北望竹园CBD、浦东大道、世纪大道；南面龙阳路地铁地铁站、新国际博览中心，交通极为便利。 \r\n　　酒店拥有精心设计的各类客房，当您走进汉庭的客房，自会感受到它人性化的细节设计和时尚的理念。时尚简约的双床房、宽敞舒适的高级特大床房以及温馨商旅的家庭房等，更有商务首','100105',31.2157,121.533,36,'B00155H8AP','2010-01-02 00:00:00','2011-07-18 06:56:52'),(64011,2,'小吃快餐X','麦当劳(番禺繁华路店)','市桥繁华路90号新亦发商业城首层102商铺','020-84877718','暂无描述信息.','050300',22.9423,113.36,236,'B00140ACHK','2010-01-02 00:00:00','2011-07-18 06:56:52'),(64019,2,'小吃快餐X','(丹灶服务区)快餐厅','广东省佛山市南海区西二环南段丹灶服务区','','暂无描述信息.','050300',23.0438,112.9,241,'B02F5070EG','2010-01-02 00:00:00','2011-07-18 06:56:53'),(64021,2,'小吃快餐X','迎众快餐','广东省佛山市南海区南新三路','0757-86333372','暂无描述信息.','050300',23.0278,113.151,241,'B02F5073EQ','2010-01-02 00:00:00','2011-07-18 06:56:53'),(64023,2,'小吃快餐X','华莱士(南新三路)','广东省佛山市南海区南新三路','','暂无描述信息.','050300',23.028,113.151,241,'B02F5078ZG','2010-01-02 00:00:00','2011-07-18 06:56:54'),(64025,2,'小吃快餐X','麦当劳(朝阳西路)','大石镇朝阳西路大石城商业中心1层101铺(近大石桥南站)','020-84788886','暂无描述信息.','050300',23.025,113.309,236,'B00140UDU2','2010-01-02 00:00:00','2011-07-18 06:56:54'),(64029,2,'小吃快餐X','麦当劳(新江路店)','洛浦街105国道','020-34508626','暂无描述信息.','050300',23.0383,113.309,236,'B00140NHRJ','2010-01-02 00:00:00','2011-07-18 06:56:54'),(64031,2,'小吃快餐X','大一煲美食','南海大道北44-23','0757-86280266','暂无描述信息.','050300',23.043,113.139,241,'B02F5017BA','2010-01-02 00:00:00','2011-07-18 06:56:55'),(64033,2,'小吃快餐X','珠江快餐店','广东省佛山市南海区海二路','0757-86233674','暂无描述信息.','050300',23.0448,113.138,241,'B02F50736X','2010-01-02 00:00:00','2011-07-18 06:56:55'),(64037,2,'小吃快餐X','麦当劳(盈丰路店)','盈丰路1-5号','','暂无描述信息.','050300',23.0694,113.297,236,'B00140T88E','2010-01-02 00:00:00','2011-07-18 06:56:56'),(64041,2,'小吃快餐X','肯德基(金沙路)','工业大道路76-80号家乐福1层','020-89611427','暂无描述信息.','050300',23.0905,113.258,236,'B00140B8H6','2010-01-02 00:00:00','2011-07-18 06:56:56'),(64045,2