休闲快乐时光。','100105',31.2073,121.477,36,'B00155HQEO','2010-01-02 00:00:00','2011-07-18 07:02:34'),(66231,8,'四星级宾馆X','上海名都城酒店公寓','虹许路788号','021-64050404','　　上海名都城酒店公寓是由上海仲盛酒店管理有限公司经营管理的星级酒店式公寓，位于古北名都城内。公寓拥有豪华配备的二房二厅和三房二厅。装饰华贵的公寓会所融餐饮、会议、娱乐、健身等设施为一体，是您举行小型会议，朋友聚会以及家庭度假的好去处。\r\n','100103',31.1909,121.395,36,'B00155N1DF','2010-01-02 00:00:00','2011-07-18 07:02:34'),(66251,8,'四星级宾馆X','斯亚花园酒店','太平门东街2号','025-84805888','暂无描述信息.','100103',32.0571,118.813,11,'B00190514C','2010-01-02 00:00:00','2011-07-18 07:02:37'),(66253,8,'三星级宾馆X','南京太阳宫广场酒店','太平门阳光路3号','025-85486222','暂无描述信息.','100104',32.0653,118.813,11,'B00190BF45','2010-01-02 00:00:00','2011-07-18 07:02:37'),(66259,2,'小吃快餐X','晓麟茶餐厅','浙江省杭州市上城区之江路','0571-87291204','暂无描述信息.','050300',30.2118,120.17,122,'0','2010-01-02 00:00:00','2011-07-18 07:02:38'),(66265,1,'加油加气站X','加油站(东杨坊)','暂无地址','','暂无描述信息.','010100',32.0962,118.881,11,'B00190AA0Q','2010-01-02 00:00:00','2011-07-18 07:02:39'),(66271,2,'便民商店/便利店X','乡村美味烤鸡烤鸭化纤厂店','暂无地址','025-85336319','暂无描述信息.','060200',32.1254,118.844,109,'B00190B9GT','2010-01-02 00:00:00','2011-07-18 07:02:40'),(66379,2,'台湾福建菜X','欢乐园农庄','钟村街','020-34777068;020-233','暂无描述信息.','050110',22.9573,113.288,236,'B00140W1Z5','2010-01-02 00:00:00','2011-07-18 07:02:55'),(66411,2,'湖北湖南菜X','湘滨楼湘菜馆','富园大街1','020-34812483','暂无描述信息.','050108',22.9482,113.366,236,'B00140NP04','2010-01-02 00:00:00','2011-07-18 07:02:59'),(66413,2,'川菜X','老张川菜馆','广东省广州市番禺区汀沙一大街','','暂无描述信息.','050102',22.9481,113.366,236,'B00140MEXC','2010-01-02 00:00:00','2011-07-18 07:03:00'),(66417,2,'川菜X','老太婆川菜馆','广东省广州市番禺区二大街48号','020-34805117','暂无描述信息.','050102',22.9486,113.365,236,'B00140VAUW','2010-01-02 00:00:00','2011-07-18 07:03:00'),(66429,2,'台湾福建菜X','冰饺城','浙江省杭州市下城区白石路','','暂无描述信息.','050110',30.3112,120.165,122,'B023B07ZAJ','2010-01-02 00:00:00','2011-07-18 07:03:02'),(66447,2,'台湾福建菜X','彪子特味烧烤王','浙江省杭州市下城区白石路','','暂无描述信息.','050110',30.3113,120.165,122,'B023B07ZAL','2010-01-02 00:00:00','2011-07-18 07:03:04'),(66483,2,'湖北湖南菜X','湘味浓毋米粥','新城大